import React, { useState } from 'react';
import Papa from 'papaparse';

function calcHT(priceTTC) {
  return priceTTC / 1.2;
}

function calcMarge(venteHT, achatHT) {
  return ((venteHT - achatHT) / venteHT) * 100;
}

function CommandeView() {
  const [data, setData] = useState([]);
  const [enrichedData, setEnrichedData] = useState([]);

  const handleFileUpload = (e) => {
    const file = e.target.files[0];
    Papa.parse(file, {
      header: true,
      complete: (results) => {
        const cleaned = results.data.filter(row => row['No. d\'article']);
        setData(cleaned);
        enrichWithAPI(cleaned);
      },
    });
  };

  const enrichWithAPI = async (rows) => {
    const enriched = await Promise.all(
      rows.map(async (row) => {
        const reference = row["No. d'article"];
        const urlProduct = `http://localhost:4000/api/product/${reference}`;
        const urlCombination = `http://localhost:4000/api/combination/${reference}`;

        let type = 'product';
        let prestaId = null;
        let stock = null;
        let priceHT = null;

        try {
          const res = await fetch(urlProduct);
          if (res.ok) {
            const xml = await res.text();
            prestaId = extractFromXML(xml, 'id');
            stock = parseInt(extractFromXML(xml, 'quantity')) || 0;
            priceHT = parseFloat(extractFromXML(xml, 'wholesale_price')) || 0;
          } else {
            const resCombo = await fetch(urlCombination);
            if (resCombo.ok) {
              const xml = await resCombo.text();
              prestaId = extractFromXML(xml, 'id');
              stock = parseInt(extractFromXML(xml, 'quantity')) || 0;
              priceHT = parseFloat(extractFromXML(xml, 'wholesale_price')) || 0;
              type = 'combination';
            }
          }
        } catch (err) {
          console.error('Erreur enrichissement :', err);
        }

        const priceTTC = parseFloat(row['prix']) || 0;
        const achatHT = calcHT(priceTTC);
        const marge = priceHT ? calcMarge(priceHT, achatHT) : null;

        return {
          ...row,
          prestaId,
          stock,
          priceHT,
          marge,
          achatHT,
          isCombination: type === 'combination',
        };
      })
    );

    setEnrichedData(enriched);
  };

  const extractFromXML = (xml, tag) => {
    const regex = new RegExp(`<${tag}><!\[CDATA\[(.*?)\]\]><\/${tag}>`);
    const match = xml.match(regex);
    return match ? match[1] : '';
  };

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Importer une commande CSV</h2>
      <input type="file" accept=".csv" onChange={handleFileUpload} className="mb-4" />

      <table className="table-auto w-full border border-gray-300 text-sm">
        <thead>
          <tr className="bg-gray-200">
            <th className="border px-2 py-1">R√©f√©rence</th>
            <th className="border px-2 py-1">Nom</th>
            <th className="border px-2 py-1">Marque</th>
            <th className="border px-2 py-1">Prix achat (TTC)</th>
            <th className="border px-2 py-1">Prix achat (HT)</th>
            <th className="border px-2 py-1">Prix vente (HT)</th>
            <th className="border px-2 py-1">Taux de marge</th>
            <th className="border px-2 py-1">Qt√© command√©e</th>
            <th className="border px-2 py-1">Stock actuel</th>
            <th className="border px-2 py-1">Presta ID</th>
            <th className="border px-2 py-1">Type</th>
          </tr>
        </thead>
        <tbody>
          {enrichedData.map((item, index) => (
            <tr key={index} className="text-center">
              <td className="border px-2 py-1">{item["No. d'article"]}</td>
              <td className="border px-2 py-1">{item["Titre"]}</td>
              <td className="border px-2 py-1">{item["Brand"]}</td>
              <td className="border px-2 py-1">{item["prix"]}</td>
              <td className="border px-2 py-1">{item.achatHT?.toFixed(2)}</td>
              <td className="border px-2 py-1">{item.priceHT?.toFixed(2)}</td>
              <td className="border px-2 py-1">{item.marge ? item.marge.toFixed(1) + " %" : "-"}</td>
              <td className="border px-2 py-1">{item["qt√©."]}</td>
              <td className="border px-2 py-1">{item.stock}</td>
              <td className="border px-2 py-1">{item.prestaId}</td>
              <td className="border px-2 py-1">{item.isCombination ? 'combination' : 'product'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CommandeView;
